import axios from "axios";
import ProductRow from "./ProductRow";

export default function CallAPIView() {
  var rows: any[] = [];
    try {
        axios.get('http://localhost:3001/getProducts').then((response) => {
          console.log(response.data);
        console.log(response.data.PRODUCTS);
        response.data.PRODUCTS.forEach((product:any) => {
          console.log(product);
          rows.push(
            <ProductRow
            product={product} />
          );
      });
        });

        return (
          <table>
            <thead>
              <tr>
                <th>Nombre</th>
                <th>Categoria</th>
                <th>Unidades</th>
              </tr>
            </thead>
            <tbody>{rows}</tbody>
          </table>
        )

    } catch (err) {
        // Handle Error Here
        console.error(err);
        return (
          <table>
            <thead>
              <tr>
                <th>Nombre</th>
                <th>Categoria</th>
                <th>Unidades</th>
              </tr>
            </thead>
            <tbody>{rows}</tbody>
          </table>
        )
    }
  };
